CREATE TABLE IF NOT EXISTS category (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT NOT NULL UNIQUE
);

INSERT INTO category(name) VALUES ('Books');
INSERT INTO category(name) VALUES ('Coffee Mugs');
INSERT INTO category(name) VALUES ('Mouse Pads');
INSERT INTO category(name) VALUES ('Luggage Tags');
INSERT INTO category(name) VALUES ('Apparel');
INSERT INTO category(name) VALUES ('Footwear');

CREATE TABLE IF NOT EXISTS product (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    sku TEXT UNIQUE NOT NULL,
    name TEXT NOT NULL,
    description TEXT,
    image_url TEXT,
    active BOOLEAN NOT NULL DEFAULT 1,
    units_in_stock INTEGER NOT NULL DEFAULT 0,
    unit_price DECIMAL(13, 2) DEFAULT NULL CHECK (unit_price >= 0),
    category_id INTEGER,
    FOREIGN KEY (category_id) REFERENCES category(id)
);


